import React from 'react'
import { data } from './datas.json'

function Card () {
	return (
		<div className='dataLogement'>
			{ 
			data.map((data,i) => (
				<div className='dataComponents' key={i}>
					<p> ID:{ data.title }</p>
					<p>Title :{ data.id }</p>
					<img src={ data.cover } alt={ data.title } />
		</div>	
		))
		}
		</div>
	)
}
export default Card;
